    [],nt"num_tags": 8,nt"name": "tewaukon-national-wildlife-refuge-complex-annual-habitat-work-plan-2005",nt"isopen":
    false,nt"url": null,nt"notes": "This annual habitat management plan outlines
    working habitat objectives for wetland habitats based on refuge purposes, professional
    judgment and experience for Tewaukon National Wildlife Refuge Complex for the year
    2005.  It includes the 2005 water management plan and 2004 water use report. The
    water use report and management plan discusses work completed on water control structures,
    water level management, and pool elevations for 2004 and planned 2005 management.
    Annual habitat management plans address the resources of concern, habitat objectives,
    current conditions, monitoring emphasis, and management prescription by acres for
